var storedSymbols = [];
var paint = false; // used by the canvas drawing code

var NMATCHES = 6; // number of matches to display
var LEARNING_RATE = 0.1 // the perceptron learning rate, alpha

$(document).ready(function() {
    
    $("#clear-button").on("click",function(){
        var querySymbol = preprocessSymbol({ xs:clickX, ys:clickY, drags:clickDrag});
        perceptron(undefined,querySymbol); // penalize all the displayed options
        $("#selectWord").empty(); // an empty canvas shouldn't match anything
        clearCanvas();
        clickX.length = 0;
        clickY.length = 0;
        clickDrag.length = 0;
    });
   
    $("#record-button").on("click",function(){
        var symbol = { xs:clickX.slice(), ys:clickY.slice(), drags:clickDrag.slice()};
        // clickX, clickY, and clickDrag are variables used by the canvas drawing code.
        storedSymbols.push(preprocessSymbol(symbol,$("#new_word").val()));
        // preprocessSymbol adds a list-of-strokes representation to the
        // symbol and attaches the word. The resulting symbol has
        // both xs/ys/drags and list-of-strokes data, since the former will be
        // used for displaying the symbol.
        
        // now clear the canvas
        $("#selectWord").empty();
        clearCanvas();
        clickX.length = 0;
        clickY.length = 0;
        clickDrag.length = 0;
        
        $("#new_word").val('');
    });
});

// preprocessSymbol adds a list-of-strokes representation to the
// symbol and attaches the word. The resulting symbol has
// both xs/ys/drags and list-of-strokes data, since the former will be
// used for displaying the symbol.
function preprocessSymbol(symbol,symbolWord) {
    var datum = {word:symbolWord}
    datum.strokes = toStrokes(symbol);
    datum.pointsAndDrags = symbol; // store so we can use later
    return datum;
}

function toStrokes(symbol) {
    var strokes = [];
    var stroke = [];
    var len = symbol.xs.length;
    var prev_x = undefined;
    var prev_x = undefined;
    for (var i = 0; i < len; i++) {
        if (symbol.drags[i]) {
            // add to current stroke
            // but only if different enough from the previous point in this stroke
            var x_distinct = Math.abs(prev_x - symbol.xs[i]) > 2;
            var y_distinct = Math.abs(prev_y - symbol.ys[i]) > 2;
            // prev_x, prev_y will never be undefined because this
            // is not the first point in a stroke
            if (x_distinct || y_distinct) {
                stroke.push({x:symbol.xs[i],y:symbol.ys[i]});
                prev_x = symbol.xs[i];
                prev_y = symbol.ys[i];
            }
        } else {
            // start a new stroke
            // always add this point
            strokes.push(stroke.slice());
            stroke = [];
            stroke.push({x:symbol.xs[i],y:symbol.ys[i]});
            prev_x = symbol.xs[i];
            prev_y = symbol.ys[i];
        }
    }
    strokes.push(stroke.slice());
    strokes.splice(0,1);
    return strokes;
}


// I only collected the strokes [[point]] for the training
// data, so to display it I need to convert back to the
// drags format [(x,y,isDrag)].
function toDrags(symbol) {
    symbol.pointsAndDrags = {};
    symbol.pointsAndDrags.xs = [];
    symbol.pointsAndDrags.ys = [];
    symbol.pointsAndDrags.drags = [];
    for (var i = 0; i < symbol.strokes.length; i++) {
        for (var j = 0; j < symbol.strokes[i].length; j++) {
            if (j==0) {
                symbol.pointsAndDrags.drags.push(false);
            } else {
                symbol.pointsAndDrags.drags.push(true);
            }
            symbol.pointsAndDrags.xs.push(symbol.strokes[i][j].x);
            symbol.pointsAndDrags.ys.push(symbol.strokes[i][j].y);
        }
    }
    return symbol;
}

// create a small canvas showing a symbol and a word
// you can click on it to select that word
// modified from code in the main canvas (which I didn't write)
function makeMiniCanvas(id,fullSymbol,querySymbol) {
    var symbol = fullSymbol.pointsAndDrags;
    var word = fullSymbol.word;
	var canvasDiv = document.getElementById('selectWord');
	c = document.createElement("canvas");
	c.setAttribute('width', miniCanvasWidth);
	c.setAttribute('height', miniCanvasHeight);
	c.setAttribute('id', id);
	canvasDiv.appendChild(c);
	$("#"+id).addClass("wordOption").on("click",function(){
	    perceptron(fullSymbol,querySymbol);
	    var currentOut = $("#outText").val();
	    currentOut += " " + word;
	    trainLanguageModel(word);
	    $("#outText").val(currentOut);
	    clearCanvas();
	    clickX.length = 0;
        clickY.length = 0;
        clickDrag.length = 0;
	});
	if(typeof G_vmlCanvasManager != 'undefined') {
		c = G_vmlCanvasManager.initElement(c);
	}
	con = c.getContext("2d"); // Grab the 2d canvas context
	// Note: The above code is a workaround for IE 8 and lower. Otherwise we could have used:
	//     context = document.getElementById('canvas').getContext("2d");
	
	var locX;
	var locY;
	
	var localclickX = symbol.xs;
	var localclickY = symbol.ys;
	var localclickDrag = symbol.drags;
		
	var radius;
	var i = 0;
	for(; i < localclickX.length; i++)
	{		

		radius = 2.5;
		context.beginPath();
		if(localclickDrag[i] && i){
			con.moveTo(localclickX[i-1]/2, localclickY[i-1]/2);
		}else{
			con.moveTo(localclickX[i]/2, localclickY[i]/2);
		}
		con.lineTo(localclickX[i]/2, localclickY[i]/2);
		con.closePath();
		

		con.strokeStyle = clickColor[1];
		con.lineJoin = "round";
		con.lineWidth = radius;
		con.stroke();
		
	}
	//context.globalCompositeOperation = "source-over";// To erase instead of draw over with white
	
	
	con.globalAlpha = 1; // No IE support
	
	con.font="20px Georgia";
    con.fillText(word,10,20);
}

function score(symbol1,symbol2) {
    var sum = 0.0;
    var len = features.length;
    for (var index = 0; index < len; ++index) {
        sum += features[index][0](symbol1,symbol2) * features[index][1];
        // feature's score * feature's weight
    }
    return sum;
    
}

// call this function to display the best matches
function searchForMatchingSymbols() {
    $("#selectWord").empty(); // remove old matches
    var scored = [];
    var currentSymbol = preprocessSymbol({ xs:clickX, ys:clickY, drags:clickDrag});
    for (index = 0; index < storedSymbols.length; ++index) {
        scored.push([storedSymbols[index],
                     Math.exp(score(storedSymbols[index],currentSymbol))
                     ]);
    }
    // the Math.exp makes this a log-linear maxent model
    // now sort the best (highest scoring) stored symbols to the front of the list
    scored.sort(function (a,b) { return (b[1] - a[1]); });
    var nBest = scored.slice(0,NMATCHES);
    displayedOptionSymbols = nBest.map(function(x) {return(x[0]);}); 
        // the perceptron uses this global var displayedOptionSymbols
    for (index = 0; index < nBest.length; ++index) {
        makeMiniCanvas("option"+index,nBest[index][0],currentSymbol);
    }
}

var displayedOptionSymbols = [];

// adjust the weights of the features to perform one
// step of the perceptron algorithm.
function perceptron(chosenSymbol,querySymbol) {
// if chosenSymbol is undefined, then all the 
// displayedOptionSymbols get negative feedback

    if (chosenSymbol === undefined) {
        for (var index = 0; index < displayedOptionSymbols.length; ++index) {
            adjustFeatures(displayedOptionSymbols[index],
                           querySymbol,
                           0); // negative feedback all around
        }
    } else {
        for (var index = 0; index < displayedOptionSymbols.length; ++index) {
            if (displayedOptionSymbols[index].word == chosenSymbol.word) {
                adjustFeatures(displayedOptionSymbols[index],
                               querySymbol,
                               1);
            } else {
                adjustFeatures(displayedOptionSymbols[index],
                               querySymbol,
                               0);
            }
        } // end for each displayed symbol
    } // end if chosenSymbol === undefined
}

function adjustFeatures(storedSymbol,querySymbol,desiredScore) {
    var len = features.length;
    for (var index = 0; index < len; ++index) {
        var actualScore = features[index][0](storedSymbol,querySymbol) * features[index][1];
        features[index][1] += LEARNING_RATE * (desiredScore - actualScore);
        // constrain weights to interval [0,1];
        if (features[index][1] > 1) {
            features[index][1] = 1;
        } else if (features[index][1] < 0) {
            features[index][1] = 0;
        }
    }
}

// differenceBy :: (Symbol -> Double) -> Double -> (Symbol -> Symbol -> Double)
// the 'scale' should be the distance between the max and min
function differenceBy(f,scale) {
    return ( function(s1,s2){
        try {
            var loose = 1-Math.abs(f(s1) - f(s2))/scale;
            // negative because difference is bad
            if (loose > 1) {
                return 1.0;
            } else if (loose < 0) {
                return 0.0;
            } else {
                return loose;
            }
        } catch(err) {
            return 0;
        }
    });
}

// same, but expects each function to give an array of numbers
function arrayDifferenceBy(f,scale) {
    return ( function(ns1,ns2){
        try {
            var avgError = 0;
            var len = Math.min(ns1.length,ns2.length);
            for (var i = 0; i < len; i++) {
                avgError += Math.abs(ns1[i] - ns2[i]);
            }
            var loose = 1-(avgError/len/scale);
            // negative because difference is bad
            if (loose > 1) {
                return 1.0;
            } else if (loose < 0) {
                return 0.0;
            } else {
                return (isNaN(loose)?0:loose);
            }
        } catch(err) {
            return 0;
        }
    });
}

// In following functions, adding 0.01 prevents a div by 0 error.
// Errors are caught, but NaNs are infectious.

// LANGUAGE MODEL

// trigrams has type [{words[3],count}]
var trigrams = [];
var prev_word = "";
var prev_prev_word = "";

function trigramScore(w) {
    var totalCount = 0.01;
    var thisCount = 0;
    for (var i = 0; i < trigrams.length; i++) {
        if (trigrams[i].words[1] == prev_word && 
            trigrams[i].words[2] == prev_prev_word) {
            
            totalCount += trigrams[i].count;
            if (trigrams[i].words[0] == w) {
                thisCount = trigrams[i].count;
            }
        }
    }
    return (thisCount/totalCount);
}

function trainTrigram(w) {
    var foundP = false;
    for (var i = 0; i < trigrams.length; i++) {
        if (trigrams[i].words[0] == w && 
            trigrams[i].words[1] == prev_word &&
            trigrams[i].words[2] == prev_prev_word) {
            
            trigrams[i].count++;
            foundP = true;
        }
    }
    if (!foundP) {
        trigrams.push({words:[w,prev_word,prev_prev_word],count:1});
    }
    // get ready for the next word
    prev_prev_word = prev_word;
    prev_word = w;
}

function resetTrigram() {
    trigrams = [];
    prev_word = "";
    prev_prev_word = "";
}

// use these functions elsewhere, not the trigram-specific
// functions defined above, so that the language model can
// be changed just by changing these three functions.

function languageModelAsFeature(s1,s2) {
    // score is called as
    // score(storedSymbols[index],currentSymbol)
    // We want to evaluate the stored symbol's word
    return(trigramScore(s1.word));
}

function trainLanguageModel(w) {
    trainTrigram(w);
}

function resetLanguageModel() {
    resetTrigram();
}

